import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './BankLayouts.css';
import { FaBank } from 'react-icons/fa';

const BankLayouts = () => {
  const [layouts, setLayouts] = useState([]);

  useEffect(() => {
    fetch('URL_DA_API/layouts')
      .then(response => response.json())
      .then(data => setLayouts(data))
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  return (
    <div className="bank-layouts">
      <h1>Layouts dos Bancos</h1>
      <ul>
        {layouts.map(layout => (
          <li key={layout.id}>
            <div className="bank-info">
              <FaBank />
              <span>{layout.name} - {layout.type}</span>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default BankLayouts;
